<p><code v-pre>ArrayList</code>实现了<code v-pre>List</code>接口，是顺序容器，即元素存放的数据与放进去的顺序相同，允许放入<code v-pre>null</code>元素，底层通过<strong>数组实现</strong>。除该类未实现同步外，其余跟<code v-pre>Vector</code>大致相同。每个<code v-pre>ArrayList</code>都有一个容量<code v-pre>(capacity)</code>，表示底层数组的实际大小，容器内存储元素的个数不能多于当前容量。当向容器中添加元素时，如果容量不足，容器会自动增大底层数组的大小。前面已经提过，<code v-pre>Java</code>泛型只是编译器提供的语法糖，所以这里的数组是一个<code v-pre>Object</code>数组，以便能够容纳任何类型的对象。</p>
